import React from 'react'

export  function FormData({name, email, img}) {
  return (
    <div>



        <h1>Account detail</h1>
        <p>Name: {name}</p>
        <p>Email: {email}</p>
        {img && <img src={img} alt="Uploaded" />}
    </div>
  )
}
